import 'bootstrap/dist/css/bootstrap.min.css';
import generateMainPage from "./Pages/MainPage";
import generateCategory from "./Pages/Category";
import {BrowserRouter as Router, Route, Switch } from "react-router-dom"

function App() {
  // return (
